import AuthenticationService from '@/services/AuthenticationService';
export default {
  data: function data() {
    return {
      nickName: '',
      amountUSDT: 0,
      amountBTC: 0,
      amountETH: 0,
      amountPAYPAL: 0,
      amountVND: 0
    };
  },
  methods: {
    addMoney: function addMoney() {
      var _this = this;

      if (this.nickName == '') {
        return this.$vs.notify({
          text: 'Biệt danh không được rỗng!',
          color: 'warning',
          iconPack: 'feather',
          icon: 'icon-check'
        });
      }

      var obj = {
        nick: this.nickName,
        aUSDT: this.amountUSDT,
        aBTC: this.amountBTC,
        aETH: this.amountETH,
        aPAYPAL: this.amountPAYPAL,
        aVND: this.amountVND
      };
      AuthenticationService.addMoneyMember(obj).then(function (res) {
        var d = res.data;

        if (!d.success) {
          localStorage.removeItem('token');

          _this.$router.push('/pages/login').catch(function () {});
        } else {
          // tránh tình trạng click nhìu lần sinh ra + nhiều
          _this.amountUSDT = 0;
          _this.amountBTC = 0;
          _this.amountETH = 0;
          _this.amountPAYPAL = 0;
          _this.amountVND = 0;
          return _this.$vs.notify({
            text: "Tr\u1EEB ti\u1EC1n cho t\xE0i kho\u1EA3n ".concat(_this.nickName, " th\xE0nh c\xF4ng."),
            iconPack: 'feather',
            icon: 'icon-check',
            color: 'success'
          });
        }
      });
    }
  }
};
